#include "gtest/gtest.h"
#include <cstring>
#include "parse.c"

TEST(test_parse_overflow, len_equal)
{
        char setcommand[] = "set \"ajsjdhsjdj\" \"\"";

        struct parse_res res;
        alloc_parse(&res);
        parse(setcommand, strlen(setcommand), &res);
        // sdd(res.op2 + 2048);
        // EXPECT_STREQ(, "a");
        EXPECT_EQ(strlen(res.op2), 65535);
        free_parse(&res);

        // struct parse_res res;
        alloc_parse(&res);
        parse(setcommand, strlen(setcommand), &res);
        // sdd(res.op2 + 2048);
        // EXPECT_STREQ(, "a");
        EXPECT_EQ(strlen(res.op2), 65535);
        free_parse(&res);
}

int main() 
{
        testing::InitGoogleTest();
        return RUN_ALL_TESTS();
}